code.image_strip:
function [y, error, valid] = image_strip(u)
% trim out horizontal slice of image
y = u(275:425, :, :);
dy = double(y);
redness = dy(:,:,1)./vecnorm(dy,2,3);
y_reduction = max(redness,[],1);
fmin = find(y_reduction>0.7, 1, 'first');
fmax = find(y_reduction>0.7, 1, 'last');
if isempty(fmin) | isempty(fmax)
    valid = 0;
    error = nan;
else
    valid = 1;
    min_value = [find(y_reduction>0.7, 1, 'first')];
    max_value = [find(y_reduction>0.7, 1, 'last')];
    error = ((max_value(1) + min_value(1))/2 - 320)/320;
end
